import React, { Component } from "react";

class CustomerOrder extends Component {
  constructor(props) {
    super(props);

    this.state = {
      customerOrder: []
    };
  }

  render() {
    return (
      <div id="customerOrder">
        hello world
      </div>
    );
  }
}

export default CustomerOrder;
